CREATE TABLE `notification` (
  `notification_id` bigint NOT NULL AUTO_INCREMENT,
  `created_at` datetime(6) NOT NULL,
  `message` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `noti_title` enum('ACTION_DONE','ACTION_FAIL','DISCOLORATION','HUMIDITY','NUTRIENT_CONC','TEMPERATURE','WATER_LEVEL') COLLATE utf8mb4_unicode_ci NOT NULL,
  `noti_type` enum('ACTION_DONE','ACTION_FAIL','IMAGE','RECOVERY','SENSOR') COLLATE utf8mb4_unicode_ci NOT NULL,
  `read_at` datetime(6) DEFAULT NULL,
  `event_id` bigint DEFAULT NULL,
  `inference_id` bigint DEFAULT NULL,
  `plant_id` bigint NOT NULL,
  `user_id` bigint NOT NULL,
  PRIMARY KEY (`notification_id`),
  KEY `idx_notification_user_created_at` (`user_id`,`created_at`),
  KEY `idx_notification_plant_created_at` (`plant_id`,`created_at`),
  KEY `idx_notification_event_id` (`event_id`),
  KEY `idx_notification_inference_id` (`inference_id`),
  CONSTRAINT `FK9tny62440u1epc4uthmf5mlbn` FOREIGN KEY (`inference_id`) REFERENCES `image_inference` (`inference_id`),
  CONSTRAINT `FKb0yvoep4h4k92ipon31wmdf7e` FOREIGN KEY (`user_id`) REFERENCES `user` (`user_id`),
  CONSTRAINT `FKd7mcy2484cg3e6tjixjagl74v` FOREIGN KEY (`plant_id`) REFERENCES `user_plant` (`plant_id`),
  CONSTRAINT `FKrxiki5t1ihlcr25gvaglomems` FOREIGN KEY (`event_id`) REFERENCES `sensor_event` (`event_id`)
) ENGINE=InnoDB AUTO_INCREMENT=269 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
